    <link href="https://fonts.googleapis.com/css2?family=Roboto:wght@400;500;700&family=Fredoka:wght@300;400&display=swap" rel="stylesheet">

    <style type="text/css">
        /* Styles Globaux */
        body, table, td, a { -webkit-text-size-adjust: 100%; -ms-text-size-adjust: 100%; }
        table, td { mso-table-lspace: 0pt; mso-table-rspace: 0pt; border-collapse: collapse; }
        img { border: 0; height: auto; line-height: 100%; outline: none; text-decoration: none; -ms-interpolation-mode: bicubic; }
        body { height: 100% !important; margin: 0 !important; padding: 0 !important; width: 100% !important; font-family: 'Roboto', 'Fredoka', Arial, sans-serif; background-color: #f4f4f4; color: #34495e; }

        /* Conteneur Principal */
        .email-wrapper { width: 100%; background-color: #f4f4f4; padding: 20px 0; }
        .email-container { max-width: 640px; margin: 0 auto; background-color: #ffffff; border-radius: 8px; overflow: hidden; box-shadow: 0 4px 15px rgba(0,0,0,0.07); }

        /* Header */
        .email-header { background-color: #F1C09C; color: #ffffff; padding: 30px 40px; text-align: center; }
        .email-header img { max-width: 180px; height: auto; display:block; margin: 0 auto; }
        .email-header h1 { font-family: 'Fredoka', 'Roboto', Arial, sans-serif; font-size: 30px; margin:0; color: #ffffff; font-weight: 500; }

        /* Corps */
        .email-body { padding: 30px 40px; font-size: 16px; line-height: 1.7; }
        .email-body .heading-text { font-family: 'Fredoka', 'Roboto', Arial, sans-serif; font-size: 24px; color: #2c3e50; margin-top:0; margin-bottom: 20px; font-weight: 500; }
        .email-body p { margin: 0 0 16px 0; }
        .email-body .button-primary {
            display: inline-block; background-color: #F1C09C; color: #ffffff !important; font-family: 'Roboto', 'Fredoka', Arial, sans-serif;
            font-size: 16px; font-weight: 500; text-decoration: none; padding: 12px 25px; border-radius: 25px; text-align:center;
            border: none; min-width: 180px;
        }

        /* Footer */
        .email-footer { padding: 30px 40px; border-top: 1px solid #eeeeee; text-align: center; }
        .email-footer .footer-text { font-size: 14px; color: #7f8c8d; line-height: 1.6; margin: 0 0 10px 0; }
        .email-footer .footer-link { color: #F1C09C; text-decoration: underline; }
        .email-footer .social-icons-table { margin: 0 auto 20px auto; }
        .email-footer .social-icons-table td { padding: 0 8px; }
        .email-footer .social-icons-table svg { display: block; fill: #333333; } /* Couleur par défaut des icônes SVG */
        .email-footer .address-text { font-size: 12px; color: #95a5a6; margin: 0 0 10px 0; line-height:1.5; }
        .email-footer .unsubscribe-link { font-size: 12px; color: #95a5a6; text-decoration: underline; }

        /* Responsive */
        @media screen and (max-width: 600px) {
            .email-container { width: 100% !important; max-width: 100% !important; border-radius: 0; margin:0; }
            .email-header, .email-body, .email-footer { padding: 25px !important; }
            .email-header img { max-width: 150px !important; }
            .email-header h1 { font-size: 26px !important; }
            .email-body .heading-text { font-size: 20px !important; }
            .email-body, .email-body p { font-size: 15px !important; }
            .email-body .button-primary { padding: 12px 20px !important; width: 100% !important; display: block !important; box-sizing: border-box; }
            .email-footer .social-icons-table td { padding: 0 6px !important; }
            .email-footer .social-icons-table svg { width: 22px !important; height: 22px !important; }
        }
    </style>
</head>
